import unittest
from time import time as timer
from EqualizeBinaryStringAstar import Solution

# running: python -m unittest EqualizeBinaryString.TestClass
class TestSolution(unittest.TestCase):
    def setUp(self):
        self.startTime = timer()
        self.agent = Solution()
        
    def tearDown(self):
        self.endTime = timer()
        t = self.endTime - self.startTime
        print('%s: %.5f' % (self.id(), t))
        
    #('110', 1, 1),
    def test_01(self):
        s = '110'
        k = 1
        answer = 1
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    # ('0101', 3, 2)
    def test_02(self):
        s = '0101'
        k = 3
        answer = 2
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    # ('101', 2, -1),
    def test_03_no_soln(self):
        s = '101'
        k = 2
        answer = -1
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
        
    # ('00001001', 7, 6),
    def test_04(self):
        s = '00001001'
        k = 7
        answer = 6
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    # ('0101000001001', 3, 3),
    def test_05(self):
        s = '0101000001001'
        k = 3
        answer = 3
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
        
