    def test_08(self):
        s = '0010110001100'
        k = 6
        answer = 2
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)

    # ('0110010001', 4, 2),
    def test_09(self):
        s = '0110010001'
        k = 4
        answer = 2
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    # ('0101111110', 7, 3)
    def test_10(self):
        s = '0101111110'
        k = 7
        answer = 3
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    def test_11(self):
        s = '000101101011110'
        k = 13
        answer = 5
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    def test_12(self):
        s = ''
        k = 534
        answer = -1
        test_soln = self.agent.minOperations(s, k)
        self.assertEqual(test_soln, answer)
    
    #@unittest.skip("too dang long")
    def test_13(self):
        s = ""
        k = 50375
        answer = 10
        test_soln = self.agent.minOperations(s, k)
        print(test_soln)
        self.assertEqual(test_soln, answer)

    if __name__ == '__main__':
        unittest.main()